import React from "react";
import { BrowserRouter, Link, Route, Switch } from "react-router-dom";

function Tutorial() {
  return (
    <div>
      intruduction of this app
      <p>
        you can login first, and put your courses, your questions and your
        answers here
      </p>
    </div>
  );
}

function AccountInfo() {
  return (
    <ul>
      <li>Name</li>
      <li>Account Number</li>
      <li>Password</li>
    </ul>
  );
}
function CourseList() {
  return (
    <ul>
      <li>react</li>
      <li>java script</li>
      <li>redux</li>
    </ul>
  );
}

function Notfound() {
  return <div>404page</div>;
}

class HomepageGuide extends React.Component {
  render() {
    return (
      <div>
        <ul>
          <li>
            <Link to="/">Home Pge</Link>
          </li>
          <li>
            <Link to="/classes">My Classes</Link>
          </li>
          <li>
            <Link to="/mine">My Accounts</Link>
          </li>
          <li>
            <Link to="/mineaaaa">Empty</Link>
          </li>
        </ul>
        <Switch>
          <Route exact path="/" component={Home}></Route>
          <Route path="/classes" component={CourseList}></Route>
          <Route path="/mine" component={AccountInfo}></Route>
          <Route component={Notfound}></Route>
        </Switch>
      </div>
    );
  }
}

export default function Home() {
  return (
    <>
      <div>
        <header>Home Page</header>
      </div>
      <hr />
      <Tutorial />
      {/* <BrowserRouter>
        <HomepageGuide />
      </BrowserRouter> */}
    </>
  );
}
